import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (language) => {
    setTooltipVisible({ ...tooltipVisible, [language]: true });
  };

  const handleLogoLeave = (language) => {
    setTooltipVisible({ ...tooltipVisible, [language]: false });
  };

  const styles = {
    main: {
      backgroundColor: '#253041',
      color: '#C9D1D9',
      minHeight: '100vh',
      fontFamily: "'Roboto', sans-serif",
    },
    heroSection: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '2rem',
      flexDirection: isMobileView ? 'column' : 'row',
      marginTop: '4rem',
      padding: '0 2rem',
    },
    image: {
      width: isMobileView ? '50%' : '15%',
      borderRadius: '5%',
    },
    paragraph: {
      fontSize: isMobileView ? '18px' : '20px',
      textAlign: 'left',
      lineHeight: '1.6',
      maxWidth: isMobileView ? '95%' : '50%',
    },
    sectionHeader: {
      textAlign: 'center',
      margin: '4rem 0 2rem',
      color: '#aaa',
      fontWeight: 'normal',
      fontSize: isMobileView ? '1.2rem' : '1.5rem',
    },
    logoContainer: {
      display: 'flex',
      justifyContent: 'center',
      gap: '2rem',
      margin: '2rem 0',
    },
    logo: {
      width: isMobileView ? '30px' : '50px',
      filter: 'grayscale(100%)',
      transition: 'filter 0.3s',
    },
    tooltip: (visible) => ({
      visibility: visible ? 'visible' : 'hidden',
      opacity: visible ? 1 : 0,
      position: 'absolute',
      bottom: '130%',
      left: '50%',
      transform: 'translateX(-50%)',
      backgroundColor: '#555',
      color: '#fff',
      padding: '5px 10px',
      borderRadius: '6px',
      whiteSpace: 'nowrap',
      zIndex: 1,
      transition: 'opacity 0.2s ease-in',
      fontSize: '14px',
    }),
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: 'Renuem',
      description: 'Developed a renewable energy investment app using React Native, Node.js, and Express.js.',
    },
    {
      id: '2023-2024',
      icon: clearear,
      title: 'Clear Ear',
      description: 'Built an appointment management app.',
    },
    {
      id: '2022-2023',
      icon: mohammedGithub,
      title: 'App Developer',
      description: 'Created an app for appointment management.',
    },
    {
      id: '2022-2023',
      icon: mohammedGithub,
      title: 'Software Engineer',
      description: 'Enhanced SEO and resolved technical debt for existing projects.',
    },
    {
      id: '2021-2023',
      icon: theresidentsclub,
      title: 'The Residents Club',
      description: 'Led and managed an IT team.',
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: 'Mo\'s Games',
      description: 'Founded and managed a gaming lounge.',
    },
  ];

  return (
    <div style={styles.main}>
      <div style={styles.heroSection}>
        <img src={untitled} alt="Mohammed" style={styles.image} />
        <p style={styles.paragraph}>
          Hey, my name is Mohammed. I've been working as a data analyst and web developer for over 5 years.
          Along the way, I've picked up a bunch of programming languages and tools that help me get the job done.
          When I'm not at work, you can find me doing LeetCode, watching anime, or playing games.
        </p>
      </div>

      <h3 style={styles.sectionHeader}>Tech Languages</h3>
      <div style={styles.logoContainer}>
        {techLanguages.map(({ id, src, name }) => (
          <div key={id} style={{ position: 'relative' }}>
            <img
              id={id}
              src={src}
              alt={name}
              style={styles.logo}
              onMouseEnter={() => handleLogoHover(id)}
              onMouseLeave={() => handleLogoLeave(id)}
            />
            <span style={styles.tooltip(tooltipVisible[id])}>{name}</span>
          </div>
        ))}
      </div>

      <h3 style={styles.sectionHeader}>Work History</h3>
      <Timeline position={isMobileView ? 'right' : 'alternate'}>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id}>
            <TimelineOppositeContent
              sx={{ m: 'auto 0' }}
              align="right"
              variant="body2"
              color="#808080"
            >
              {id}
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
              <img src={icon} alt={title} style={{ width: '30px', borderRadius: '50%' }} />
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent sx={{ py: '12px', px: 2 }}>
              <Typography variant="h6" component="span">{title}</Typography>
              <Typography>{description}</Typography>
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
